import Login from "../Login/Login.js";
import {Route} from "react-router-dom";

function App() {
    return (
        <div className="App">
            <Routes>
                <Route path="/signin"
                       element={<Login />}>
                </Route>
            </Routes>
        </div>
    )
}

export default App;
